import './App.css';
import Homepage from "./Homepage"
import Navbar from "./Navbar"
import {Switch, Route} from "reas\ct-router-dom"




function App() {
  return (
    <div className="App">

      <Navbar />
      <Switch>
        <Route exact path="/">
          <Homepage />
        </Route>

        <Route path="/services">
          <ServicesList />
        </Route>

        <Route path="/services/:serviceId">
          <ServiceDetail />
        </Route>
      </Switch>

    </div>
  );
}

export default App;
